import './cart-icon.scss';
import {ReactComponent as ShoppingIcon} from '../../assets/cart.svg';


 const CartIcon = ()=>(
    <div className="cart-icon">
        <ShoppingIcon className='shopping-icon' />
        <span className='item-count'>0</span>
    </div> 
 )

 export default CartIcon;
